import React from 'react';
import DoctorDashboard from './components/DoctorDashboard';
import PatientDashboard from './components/PatientDashboard';

const App = () => {
  const appointments = [
    {
        id: 1,
        doctorName: "Dr. John Doe",
        date: "2024-10-15",
        status: "Scheduled",
        notes: [
            { author: "Patient", text: "Initial complaint: fever" },
            { author: "Doctor", text: "Prescribed antibiotics" }
        ],
        isDoctor: true, // Set to false for patients
    },
];
    return (
        <div className="App">
            <DoctorDashboard />
            <PatientDashboard />
        </div>
    );
};

export default App;
